import React from 'react';
import '../css/style-dialog.css';

class ConfirmDialog extends React.Component{
    render(){
        return(
            <div className = "dialog-container">
                <div className  = "dialog-layout">
                <h2>{this.props.heading}</h2>
                <h5>{this.props.subHeading}</h5>
                <div className ="dialog-button-section">
                    <button className = "primary-btn btn">
                        <i className = "fa fa-phone card-icon-layout"/>
                        <span>Call</span>
                    </button>
                    <button className = "danger-btn btn" onClick={this.props.onCancelButtonClick} >
                        <i className = "fa fa-phone card-icon-layout"/>
                        <span>Cancel</span>
                    </button>
                </div>
                </div>
            </div>
        );
    }
}

export default ConfirmDialog;
